import React from 'react';
import UploadButton from '../../assets/uploadbutton.svg';

const UploadButtonnComponent = () => (
  <div className="UploadButton-Component">
    <img src={UploadButton} className="homeicon" alt="homeicon" />
  </div>
);

export default UploadButtonnComponent;
